torUK on Facebook ","firstname_member":"Samuel Okakpi","surname_member":"onwuzu","default_image_name":"profile1"},{"comment":"Paracetamol can be used to relieve mild to moderate pain associated with conditions such as headaches, migraine, toothache, teething, colds and flu. It is also useful for reducing fever and discomfort associated with colds and flu. Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0y0X33 Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook","firstname_member":"Opeyemi","surname_member":"Adetura","default_image_name":"profilem2"},{"comment":"Panadol soluble tablets and Panadol ActiFast tablets work faster than standard paracetamol tablets or capsules. Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm10VOmU Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","firstname_member":"Elvis","surname_member":"onuorah","default_image_name":"profilem1"},{"comment":"In 1955, Panadol was introduced to hospitals in the United Kingdom.[1] It was first marketed by Phillips, Scott & Turner, which was acquired by Frederick Stearns & Co, a subsidiary of Sterling Drug Inc.[2] It was advertised as being \"gentle on the stomach\", since other analgesic agents at the time contained aspirin, a known stomach irritant. Panadol was originally available only by prescription in the UK, but is now available over the counter. In 1988 Sterling Winthrop was acquired by Eastman Kodak which sold the over the counter drug rights to SmithKline Beecham in 1994","firstname_member":"Nwabueze","surname_member":"Obioma","default_image_name":"profilem2"},{"comment":"onwuzu onyekachi","firstname_member":"Elvis","surname_member":"onuorah","default_image_name":"profilem1"},{"comment":"onwuzu onyekachi","firstname_member":"Elvis","surname_member":"onuorah","default_image_name":"profilem1"},{"comment":"the federal ministry of health warns that smokers are liable to die young","firstname_member":"E