INFO  - 2013-08-28 16:23:15 --> [{"id_drugcomment":"1","comment":"It is thought paracetamol reduces fever by affecting an area of the brain that regulates our body temperature (the hypothalamic heat-regulating center). Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0sXBLg Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","memberid_member":"2","drugid_drug":"1","time_created":"0000-00-00 00:00:00","id_member":"2","firstname_member":"Nwabueze","surname_member":"Obioma","gender_member":"1","dateOfBirth_member":"12 July","emailaddress_member":"zed@yahoo.com","membertypeid_membertype":"2","id_membertype":"2","name":"Male Pharmacist","description":"Male Pharmacist","default_image_name":"profilem2"},{"id_drugcomment":"2","comment":"Panadol capsules, tablets and soluble tablets and Panadol ActiFast tablets all contain the active ingredient paracetamol, which is a simple painkilling medicine used to relieve mild to moderate pain and fever. (NB. Paracetamol is also available without a brand name, ie as the generic medicine.) Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0mXCQk Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","memberid_member":"1","drugid_drug":"1","time_created":"0000-00-00 00:00:00","id_member":"1","firstname_member":"Onyekachi","surname_member":"onwuzu","gender_member":"1","dateOfBirth_member":"25 oct 2001","emailaddress_member":"oonwuzu@swifta.com","membertypeid_membertype":"1","id_membertype":"1","name":"Ordinary Member","description":"Ordinary Member","default_image_name":"profilem"},{"id_drugcomment":"3","comment":"Prostaglandins are produced by the body in response to injury and certain diseases. One of their actions is to sensitise nerve endings, so that when the injury is stimulated it causes pain (presumably to prevent us from causing further harm to the area). As paracetamol reduces the production of these nerve sensitising prostaglandins it is thought it may increase our pain threshold, so that although the injury remains, we can feel it less Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0q8vyz Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","memberid_member":"3","drugid_drug":"1","time_created":"0000-00-00 00:00:00","id_member":"3","firstname_member":"kayode","surname_member":"Adeoti","gender_member":"1","dateOfBirth_member":"0","emailaddress_member":"princeyekaso@gmail.com","membertypeid_membertype":"4","id_membertype":"4","name":"Male Nurse","description":"Male Nurse","default_image_name":"profilem"},{"id_drugcomment":"4","comment":"It is thought paracetamol reduces fever by affecting an area of the brain that regulates our body temperature (the hypothalamic heat-regulating center). Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0sXBLg Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","memberid_member":"4","drugid_drug":"1","time_created":"0000-00-00 00:00:00","id_member":"4","firstname_member":"Samuel Okakpi","surname_member":"onwuzu","gender_member":"1","dateOfBirth_member":"0","emailaddress_member":"princeyekaso@gmail.com","membertypeid_membertype":"7","id_membertype":"7","name":"Student Member","description":"Student Member","default_image_name":"profile1"},{"id_drugcomment":"5","comment":"Paracetamol can be used to relieve mild to moderate pain associated with conditions such as headaches, migraine, toothache, teething, colds and flu. It is also useful for reducing fever and discomfort associated with colds and flu. Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0y0X33 Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook","memberid_member":"5","drugid_drug":"1","time_created":"0000-00-00 00:00:00","id_member":"5","firstname_member":"Opeyemi","surname_member":"Adetura","gender_member":"1","dateOfBirth_member":"0","emailaddress_member":"princ