onwuzu","membertypeimage":"profile1"},{"id":"5","comment":"Paracetamol can be used to relieve mild to moderate pain associated with conditions such as headaches, migraine, toothache, teething, colds and flu. It is also useful for reducing fever and discomfort associated with colds and flu. Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0y0X33 Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook","membername":"Opeyemi Adetura","membertypeimage":"profilem2"},{"id":"6","comment":"Panadol soluble tablets and Panadol ActiFast tablets work faster than standard paracetamol tablets or capsules. Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm10VOmU Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","membername":"Elvis onuorah","membertypeimage":"profilem1"},{"id":"7","comment":"In 1955, Panadol was introduced to hospitals in the United Kingdom.[1] It was first marketed by Phillips, Scott & Turner, which was acquired by Frederick Stearns & Co, a subsidiary of Sterling Drug Inc.[2] It was advertised as being \"gentle on the stomach\", since other analgesic agents at the time contained aspirin, a known stomach irritant. Panadol was originally available only by prescription in the UK, but is now available over the counter. In 1988 Sterling Winthrop was acquired by Eastman Kodak which sold the over the counter drug rights to SmithKline Beecham in 1994","membername":"Nwabueze Obioma","membertypeimage":"profilem2"},{"id":"8","comment":"onwuzu onyekachi","membername":"Elvis onuorah","membertypeimage":"profilem1"},{"id":"9","comment":"onwuzu onyekachi","membername":"Elvis onuorah","membertypeimage":"profilem1"},{"id":"10","comment":"the federal ministry of health warns that smokers are liable to die young","membername":"Elvis onuorah","membertypeimage":"profilem1"},{"id":"11","comment":"hello nwa there","membername":"Elvis onuorah","membertypeimage":"profilem1"},{"id":"12","comment":"n