INFO  - 2013-08-28 17:59:44 --> [{"id":"5","comment":"Paracetamol can be used to relieve mild to moderate pain associated with conditions such as headaches, migraine, toothache, teething, colds and flu. It is also useful for reducing fever and discomfort associated with colds and flu. Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0y0X33 Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook","membername":"Opeyemi Adetura","membertypeimage":"profilem2"},{"id":"4","comment":"It is thought paracetamol reduces fever by affecting an area of the brain that regulates our body temperature (the hypothalamic heat-regulating center). Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0sXBLg Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","membername":"Samuel Okakpi onwuzu","membertypeimage":"profile1"},{"id":"3","comment":"Prostaglandins are produced by the body in response to injury and certain diseases. One of their actions is to sensitise nerve endings, so that when the injury is stimulated it causes pain (presumably to prevent us from causing further harm to the area). As paracetamol reduces the production of these nerve sensitising prostaglandins it is thought it may increase our pain threshold, so that although the injury remains, we can feel it less Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0q8vyz Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","membername":"kayode Adeoti","membertypeimage":"profilem"},{"id":"2","comment":"Panadol capsules, tablets and soluble tablets and Panadol ActiFast tablets all contain the active ingredient paracetamol, which is a simple painkilling medicine used to relieve mild to moderate pain and fever. (NB. Paracetamol is also available without a brand name, ie as the generic medicine.) Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0mXCQk Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","membername":"Onyekachi onwuzu","membertypeimage":"profilem"},{"id":"1","comment":"It is thought paracetamol reduces fever by affecting an area of the brain that regulates our body temperature (the hypothalamic heat-regulating center). Read more: http:\/\/www.netdoctor.co.uk\/aches-and-pains\/medicines\/panadol.html#ixzz2Wm0sXBLg Follow us: @NetDoctor on Twitter | NetDoctorUK on Facebook ","membername":"Nwabueze Obioma","membertypeimage":"profilem2"}]
